import React from "react";
import Card from "react-bootstrap/Card";
const Weather = () => {
  let currentCast = {};
  let fiveDayCast = fetch(
    "https://community-open-weather-map.p.rapidapi.com/forecast?q=Des%20Moines&units=imperial",
    {
      method: "GET",
      headers: {
        "x-rapidapi-host": "community-open-weather-map.p.rapidapi.com",
        "x-rapidapi-key": "bceb01c09emsh7333c7d8acd9bbfp114330jsn9662e80626cf",
      },
    }
  )
    .then((response) => {
      fiveDayCast = response.data;
      console.log(response.json);
    })
    .catch((err) => {
      console.log(err);
    });

  function getCurrentForecast() {
    fetch(
      "https://community-open-weather-map.p.rapidapi.com/weather?callback=test&units=%2522imperial%2522&q=Des%20Moines",
      {
        method: "GET",
        headers: {
          "x-rapidapi-host": "community-open-weather-map.p.rapidapi.com",
          "x-rapidapi-key":
            "bceb01c09emsh7333c7d8acd9bbfp114330jsn9662e80626cf",
        },
      }
    )
      .then((response) => {
        currentCast = response.json();
        console.log(currentCast);
      })
      .catch((err) => {
        console.log(err);
      });
  }
  // getFiveDayForecast();
  // setInterval(getFiveDayForecast, 10000);
  // setInterval(getCurrentForecast, 20000);

  return (
    <div>
      <Card>
        <Card.Body>
          <Card.Title>YO</Card.Title>
          <Card.Text>Bachelors of Science in Software Engineering</Card.Text>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Weather;
